LET’S HELP. LET’S DONATE. #TurkeyEarthquake #donations #HowtoDonate

@afadbaskanlik is Turkey’s official disaster and emergency management authority.
They accept donations in EUR and USD at afad.gov.tr/depremkampanyasi2

@akutdernegi is a voluntary, non-governmental organization involved in searching, assisting and rescuing the victims of those affected by the earthquake. They are fully transparent about how they spend donations they receive.
They accept donations in EUR and USD at akut.org.tr/en/donation

@ahbap is another local voluntary network that is currently active in the affected regions, with 200 philanthropists and 30,000 volunteers on board.
You can donate in with credit card in lira at bagis.ahbap.org

